    <script>
        // DOM Elements
        const predictBtn = document.getElementById('predict-btn');
        const periodInput = document.getElementById('period');
        const resultBig = document.getElementById('result-big');
        const resultSmall = document.getElementById('result-small');
        const outcomeModal = document.getElementById('outcome-modal');
        const closeModal = document.getElementById('close-modal');
        const winBtn = document.getElementById('win-btn');
        const lossBtn = document.getElementById('loss-btn');
        const viewHistoryBtn = document.getElementById('view-history-btn');
        const historyTab = document.getElementById('history-tab');
        const closeHistory = document.getElementById('close-history');
        const historyTableBody = document.getElementById('history-table-body');
        const loader = document.getElementById('loader');
        const totalPredictionsEl = document.getElementById('total-predictions');
        const winRateEl = document.getElementById('win-rate');
        const accuracyEl = document.getElementById('accuracy');
        const tradingView = document.getElementById('trading-view');
        const particlesContainer = document.getElementById('particles');
        
        // Store predictions history
        let predictionsHistory = JSON.parse(localStorage.getItem('quantumPredictions')) || [];
        let lastPrediction = null;
        
        // Create particles
        function createParticles() {
            for (let i = 0; i < 50; i++) {
                const particle = document.createElement('div');
                particle.classList.add('particle');
                
                const size = Math.random() * 5 + 2;
                particle.style.width = `${size}px`;
                particle.style.height = `${size}px`;
                
                particle.style.left = `${Math.random() * 100}vw`;
                particle.style.top = `${Math.random() * 100}vh`;
                
                particle.style.animationDuration = `${Math.random() * 20 + 10}s`;
                particle.style.animationDelay = `${Math.random() * 5}s`;
                
                particlesContainer.appendChild(particle);
            }
        }
        
        // Create trading chart
        function createTradingChart() {
            tradingView.innerHTML = '<div class="trading-line"></div>';
            
            // Create random candles
            const candleCount = 20;
            const candleWidth = tradingView.offsetWidth / candleCount;
            
            let previousClose = 50;
            
            for (let i = 0; i < candleCount; i++) {
                const open = previousClose;
                const high = open + Math.random() * 20;
                const low = open - Math.random() * 20;
                const close = low + Math.random() * (high - low);
                
                const candle = document.createElement('div');
                candle.classList.add('candle');
                if (close < open) candle.classList.add('red');
                
                const candleHeight = Math.abs(close - open);
                const candleTop = Math.min(open, close);
                
                candle.style.left = `${i * candleWidth + candleWidth / 2}px`;
                candle.style.height = `${candleHeight}%`;
                candle.style.bottom = `${candleTop}%`;
                
                // Add wick
                const wick = document.createElement('div');
                wick.style.position = 'absolute';
                wick.style.left = '50%';
                wick.style.transform = 'translateX(-50%)';
                wick.style.width = '1px';
                wick.style.height = `${high - low}%`;
                wick.style.backgroundColor = close >= open ? 'var(--success)' : 'var(--danger)';
                wick.style.bottom = `${low}%`;
                
                candle.appendChild(wick);
                tradingView.appendChild(candle);
                
                previousClose = close;
            }
        }
        
        // Initialize
        function init() {
            createParticles();
            createTradingChart();
            updateHistoryTable();
            calculateStats();
            
            // Check if first time user
            if (!localStorage.getItem('firstTime')) {
                setTimeout(() => {
                    alert('[SYSTEM INITIALIZED]\n\nWelcome to QUANTUM PREDICTION ENGINE\n\nEnter period number to execute neural network prediction\n\nJoin our quantum channel for updates: t.me/TradeGenius07');
                    localStorage.setItem('firstTime', 'false');
                }, 1000);
            }
        }
        
        // Advanced quantum prediction algorithm
        function generatePrediction(period) {
            // Show loading spinner
            loader.style.display = 'block';
            predictBtn.disabled = true;
            
            // Simulate quantum computing effect
            const hackingText = document.querySelector('.terminal-text');
            let originalText = periodInput.value;
            let iterations = 0;
            
            const hackingInterval = setInterval(() => {
                let hackedText = '';
                for (let i = 0; i < originalText.length; i++) {
                    hackedText += Math.random() > 0.5 ? originalText.charAt(i) : Math.floor(Math.random() * 10);
                }
                periodInput.value = hackedText;
                iterations++;
                
                if (iterations > 10) {
                    clearInterval(hackingInterval);
                    periodInput.value = originalText;
                }
            }, 100);
            
            return new Promise((resolve) => {
                setTimeout(() => {
                    const num = parseInt(period);
                    
                    // Advanced quantum algorithm
                    let prediction;
                    let accuracy;
                    
                    // Quantum pattern 1: Wave function analysis
                    const quantumState = Math.sin(num) * Math.cos(num * 0.317);
                    
                    // Quantum pattern 2: Entanglement factor
                    const entanglement = (num * 0.211) % 1;
                    
                    // Quantum pattern 3: Superposition analysis
                    const superposition = Math.abs(Math.sin(num * 0.1342) + Math.cos(num * 0.2817));
                    
                    // Pattern 4: Historical pattern matching
                    const last10 = predictionsHistory.slice(0, 10);
                    const lastWins = last10.filter(p => p.outcome === 'ACCURATE').length;
                    
                    // Decision matrix
                    if (quantumState > 0.5) {
                        prediction = 'BIG';
                        accuracy = 85 + (entanglement * 10);
                    } else if (quantumState < -0.5) {
                        prediction = 'SMALL';
                        accuracy = 83 + (entanglement * 8);
                    } else if (lastWins >= 6) {
                        // If last 6/10 were wins, maintain trend
                        const lastPred = last10[0]?.prediction;
                        prediction = lastPred === 'BIG' ? 'BIG' : 'SMALL';
                        accuracy = 80 + (superposition * 10);
                    } else {
                        // Quantum neural network fallback
                        const nnScore = Math.sin(num * 0.431) + Math.cos(entanglement * 2.5);
                        prediction = nnScore > 0 ? 'BIG' : 'SMALL';
                        accuracy = 78 + Math.abs(nnScore * 12);
                    }
                    
                    // Ensure accuracy is between 75-95
                    accuracy = Math.min(95, Math.max(75, Math.round(accuracy)));
                    
                    // Hide loader
                    loader.style.display = 'none';
                    predictBtn.disabled = false;
                    
                    resolve({
                        prediction,
                        accuracy
                    });
                }, 2000); // Simulate quantum processing time
            });
        }
        
        // Show prediction result
        async function showResult() {
            const period = periodInput.value.trim();
            
            if (!period) {
                alert('[SYSTEM ALERT]\n\nInput field cannot be empty');
                return;
            }
            
            resultBig.style.display = 'none';
            resultSmall.style.display = 'none';
            
            const { prediction, accuracy } = await generatePrediction(period);
            
            if (prediction === 'BIG') {
                resultBig.textContent = ` PREDICTION: BIG [${accuracy}% ACCURACY]`;
                resultBig.style.display = 'block';
            } else {
                resultSmall.textContent = ` PREDICTION: SMALL [${accuracy}% ACCURACY]`;
                resultSmall.style.display = 'block';
            }
            
            // Store last prediction
            lastPrediction = {
                period,
                prediction,
                accuracy,
                timestamp: new Date().toLocaleString()
            };
            
            // Show outcome modal after delay
            setTimeout(() => {
                outcomeModal.style.display = 'flex';
            }, 1000);
        }
        
        // Save prediction outcome
        function saveOutcome(outcome) {
            if (!lastPrediction) return;
            
            const predictionWithOutcome = {
                ...lastPrediction,
                outcome,
                isCorrect: (outcome === 'ACCURATE') ? true : false
            };
            
            predictionsHistory.unshift(predictionWithOutcome);
            
            // Keep only last 50 predictions
            if (predictionsHistory.length > 50) {
                predictionsHistory = predictionsHistory.slice(0, 50);
            }
            
            // Save to localStorage
            localStorage.setItem('quantumPredictions', JSON.stringify(predictionsHistory));
            
            // Update UI
            updateHistoryTable();
            calculateStats();
            
            // Close modal
            outcomeModal.style.display = 'none';
            
            // Show feedback
            const feedback = outcome === 'ACCURATE' 
                ? '[PREDICTION ACCURATE]\n\nQuantum algorithm successfully predicted outcome.' 
                : '[PREDICTION INACCURATE]\n\nNeural network learning from this result.';
            setTimeout(() => alert(feedback), 300);
        }
        
        // Update history table
        function updateHistoryTable() {
            historyTableBody.innerHTML = '';
            
            if (predictionsHistory.length === 0) {
                historyTableBody.innerHTML = `
                    <tr>
                        <td colspan="4" style="text-align: center;">No trading data available</td>
                    </tr>
                `;
                return;
            }
            
            predictionsHistory.forEach(prediction => {
                const row = document.createElement('tr');
                
                row.innerHTML = `
                    <td>${prediction.period}</td>
                    <td>${prediction.prediction} [${prediction.accuracy}%]</td>
                    <td class="${prediction.outcome === 'ACCURATE' ? 'win-text' : 'loss-text'}">
                        ${prediction.outcome}
                    </td>
                    <td>${prediction.timestamp || '-'}</td>
                `;
                
                historyTableBody.appendChild(row);
            });
        }
        
        // Calculate and display stats
        function calculateStats() {
            const total = predictionsHistory.length;
            const wins = predictionsHistory.filter(p => p.outcome === 'ACCURATE').length;
            const winRate = total > 0 ? Math.round((wins / total) * 100) : 0;
            
            // Calculate accuracy based on predictions with accuracy data
            const accuratePredictions = predictionsHistory.filter(p => p.isCorrect && p.accuracy).length;
            const totalWithAccuracy = predictionsHistory.filter(p => p.accuracy).length;
            const accuracy = totalWithAccuracy > 0 ? Math.round((accuratePredictions / totalWithAccuracy) * 100) : 0;
            
            totalPredictionsEl.textContent = total;
            winRateEl.textContent = `${winRate}%`;
            accuracyEl.textContent = `${accuracy}%`;
        }
        
        // Event Listeners
        predictBtn.addEventListener('click', showResult);
        
        closeModal.addEventListener('click', () => {
            outcomeModal.style.display = 'none';
        });
        
        winBtn.addEventListener('click', () => {
            saveOutcome('ACCURATE');
        });
        
        lossBtn.addEventListener('click', () => {
            saveOutcome('INACCURATE');
        });
        
        viewHistoryBtn.addEventListener('click', () => {
            historyTab.style.display = 'block';
            calculateStats();
        });
        
        closeHistory.addEventListener('click', () => {
            historyTab.style.display = 'none';
        });
        
        // Close modals when clicking outside
        window.addEventListener('click', (e) => {
            if (e.target === outcomeModal) {
                outcomeModal.style.display = 'none';
            }
            if (e.target === historyTab) {
                historyTab.style.display = 'none';
            }
        });
        
        // Initialize
        init();
        
        // Update chart on resize
        window.addEventListener('resize', createTradingChart);
    </script>




